import React, { Component } from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import { Route } from 'react-router';
import './App.css';
import apps from './apps';

class Home extends Component {
  render(){
    return (
      <div>
        <h1>Hi</h1>
        <h3>Welcome to NF Company Management System</h3>
      </div>
    );
  }
}

function App() {
  const routeList = Object.keys(apps.services).forEach(route => {
    console.log({route}, apps.services[route]);
    return <Route path={ `/${route}` } component={ apps.services[route] }/>
  })

  return (
    <div className="App">
      <Router>
        <Route path="/" component={Home}/>
        <Route path="/employee" component={apps.services['employee']}/>
        { routeList }
      </Router>
    </div>
  );
}

export default App;
